  fun test_cases(context : vx_core.Type_context) : vx_test.Type_testcaselist {
    var testcases : List<vx_core.Type_any> = vx_core.arraylist_from_array(
      vx_data_xmlTest.f_string_first_from_xml(context),
      vx_data_xmlTest.f_textblock_xml_from_string(context),
      vx_data_xmlTest.f_xml_angle_from_xml_textblock(context),
      vx_data_xmlTest.f_xml_close_from_xml_textblock(context),
      vx_data_xmlTest.f_xml_parse_from_xml_textblock(context),
      vx_data_xmlTest.f_xml_parse_from_xml_textblocklist(context),
      vx_data_xmlTest.f_xml_properties_from_xml_textblocklist(context),
      vx_data_xmlTest.f_xml_property_from_xml_textblock(context),
      vx_data_xmlTest.f_xml_text_from_xml_textblock(context),
      vx_data_xmlTest.f_xml_from_textblock(context)
    )
    var output : vx_test.Type_testcaselist = vx_core.vx_new(
      vx_test.t_testcaselist,
      testcases
    )
    return output
  }

